            {
                throw new NotImplementedException();
            }

            public double SignedDistanceOf(XNode node)
            {
                return node.X - xCrack;
            }

            public double SignedDistanceOf(XPoint point)
            {
                bool hasCartesian = point.Coordinates.TryGetValue(CoordinateSystem.GlobalCartesian, out double[] x);
                if (!hasCartesian)
                {
                    x = point.MapCoordinates(point.ShapeFunctions, point.Element.Nodes);
                    point.Coordinates[CoordinateSystem.GlobalCartesian] = x;
                }
                return x[0] - xCrack;
            }
        }

        private class MockNodeEnricher : INodeEnricher
        {
            private readonly IXModel model;
            private readonly ICrack crack;
            private readonly EnrichmentItem enrichment;

            public MockNodeEnricher(IXModel model, ICrack crack)
            {
                this.model = model;
                this.crack = crack;

                var stepEnrichmentFunc = new CrackStepEnrichment(crack);
                IDofType[] stepEnrichedDofs =
                {
                    new EnrichedDof(stepEnrichmentFunc, StructuralDof.TranslationX),
                    new EnrichedDof(stepEnrichmentFunc, StructuralDof.TranslationY),
                    new EnrichedDof(stepEnrichmentFunc, StructuralDof.TranslationZ)
                };
                this.enrichment = new EnrichmentItem(0, new IEnrichmentFunction[] { stepEnrichmentFunc }, stepEnrichedDofs);
            }

            public void ApplyEnrichments()
            {
                foreach (XNode node in model.Elements[1].Nodes)
                {
                    node.Enrichments.Add(enrichment);
                    foreach (IEnrichmentFunction enrichmentFunc in enrichment.EnrichmentFunctions)
                    {
                        node.EnrichmentFuncs[enrichmentFunc] = enrichmentFunc.EvaluateAt(node);
                    }
                    enrichment.EnrichedNodes.Add(node);
                }
            }

            public IEnumerable<EnrichmentItem> DefineEnrichments() => new EnrichmentItem[] { enrichment };
        }
